package coreJava;

public class Conversion {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 65556;
		double d = 12345.6;
		int b = (int)d;
		double e = a;
		System.out.println(a);
		System.out.println(d);
		System.out.println(b);
		System.out.println(e);
		
	}

}
